const BasicNavbar = () => {
  return (
    <nav style={styles.navbar}>
      <div style={styles.logo}>Logo</div>
      <ul style={styles.links}>
        <li style={styles.link}><a href="/">Home</a></li>
        <li style={styles.link}><a href="/about">About</a></li>
        <li style={styles.link}><a href="/services">Services</a></li>
        <li style={styles.link}><a href="/contact">Contact</a></li>
      </ul>
    </nav>
  );
};

const styles = {
  navbar: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '10px 20px',
    backgroundColor: '#333',
    color: '#fff',
  },
  logo: {
    fontSize: '20px',
    fontWeight: 'bold',
  },
  links: {
    listStyle: 'none',
    display: 'flex',
    margin: 0,
    padding: 0,
  },
  link: {
    marginLeft: '20px',
  },
};

export default BasicNavbar;
